    {id:'e2',title:'BIKE Insurance', amount:255.85, date:new Date(2021,2,6)},
    {id:'e3',title:'Car Insurance', amount:266.85, date:new Date(2021,7,19)},
    {id:'e4',title:'Car Insurance', amount:245.85, date:new Date(2021,42,1)}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount}></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

